//import ReactDOM from "react-dom";
import Wheel from "./components/wheel/Appwheel";
import "./indexwheel.css";

export class App extends React.Component {
  constructor() {
    super();
    this.places = [
      "General Knowldge",
      "Science",
      "Maths",
      "Video Games",
      "Geography",
      "Music",
      "Computer",
      "Entertainment",
      "Sports",
      "Movies",
    ];
  }

  render() {
    return (
      <div>
        <Wheel items={this.places} />
      </div>
    );
  }
}

export default App;
